    Slate cards' were not for individual specific federal candidates. The activities
    disclosed as 'Obama Bio Brochure' did not meet the definition of Federal Election
    Activity and didn't constitute a public communication, therefore they are on Schedule
    B for Line 21b as opposed to Schedule B for Line 30(b).  Payments for 'Fundraising
    Fees' on Schedule B were for ongoing Committee fundraising and were not on behalf
    of any candidate for federal office. Payments for 'Food and Beverage' on Schedule
    B were for staff meals and were not on behalf of any candidate for federal office.
