    and were not made on behalf of specifically identified federal candidates. Payments
    for 'Event Decorations,' 'Site Rental,' and ' Food and Beverage' on Schedule H4
    were for Committee activities and were not on behalf of any candidate for federal
    office. Schedule L-B has been corrected to reflect the transfer-out of Levin Funds.
